PdfGenerator LT build doesn't embed wkhtmltopdf binaries and can be used in non-windows environments (Linux, OS-X). Appropriate wkhtmltopdf build should be installed/deployed with your application.
How to use:

var htmlToPdfConv = new NReco.PdfGenerator.HtmlToPdfConverter();
htmlToPdfConv.License.SetLicenseKey("your_id", "your_license_key");
// for Linux/OS-X: "wkhtmltopdf"
htmlToPdfConv.WkHtmlToPdfExeName = "wkhtmltopdf.exe";
// path where wkhtmltopdf binaries are installed/deployed
htmlToPdfConv.PdfToolPath = "<path_to_wkhtmltopdf_folder>";
htmlToPdfConv.GeneratePdfFromFile("http://www.google.com", null, "google.pdf");

PdfGenerator.LT build doesn't embed wkhtmltopdf binaries and can be used in non-windows environments (Linux, OS-X) from Mono or .NET Core projects. Appropriate wkhtmltopdf binaries should be installed/deployed with your application.
How to use:

var htmlToPdfConv = new NReco.PdfGenerator.HtmlToPdfConverter();
htmlToPdfConv.License.SetLicenseKey("your_id", "your_license_key");
// for Linux/OS-X: "wkhtmltopdf"
htmlToPdfConv.WkHtmlToPdfExeName = "wkhtmltopdf.exe";
// path where wkhtmltopdf binaries are installed/deployed
htmlToPdfConv.PdfToolPath = "<path_to_wkhtmltopdf_folder>";
htmlToPdfConv.GeneratePdfFromFile("http://www.google.com", null, "google.pdf");

Please contact support@nrecosite.com if you want to get demo key for evaluation/testing purposes.

