FeedPackage.ReleaseNotes:
VideoConverter.LT build doesn't embed ffmpeg binaries and can be used in non-windows environments (Linux, OS-X) with Mono or .NET Core. Appropriate ffmpeg binaries should be installed/deployed with your application.
How to use:

var ffmpeg = new NReco.VideoConverter.FFMpegConverter();
NReco.VideoConverter.License.SetLicenseKey("your_id", "your_license_key");
ffmpeg.FFMpegExeName = "ffmpeg.exe"; // for Linux/OS-X: "ffmpeg"
ffmpeg.FFMpegToolPath = "<path_to_folder_with_ffmpeg>";
ffmpeg.ConvertMedia("input.avi",null,"output.mp4",null,new ConvertSettings());

Please contact support@nrecosite.com if you want to get a demo key for evaluation/testing purposes.
